    function generateDashboard(data) {
      if (!Array.isArray(data)) data = [data];

      const regions = {};
      const dates = {};
      const categories = {};
      const salespeople = {};
      const orderValues = {};

      data.forEach(sale => {
        const region = sale.Location || 'Unknown';
        const category = sale.TransactionType || 'Other';
        const date = sale.TransactionDate ? sale.TransactionDate.split(' ')[0] : 'N/A';
        const salesperson = sale.CustomerOccupation || 'N/A';
        const amount = parseFloat(sale.TransactionAmount) || 0;

        regions[region] = (regions[region] || 0) + amount;
        dates[date] = (dates[date] || 0) + amount;
        categories[category] = (categories[category] || 0) + amount;
        salespeople[salesperson] = (salespeople[salesperson] || 0) + amount;
        if (!orderValues[region]) orderValues[region] = [];
        orderValues[region].push(amount);
      });

      Plotly.newPlot('salesByRegion', [{
        type: 'bar',
        x: Object.keys(regions),
        y: Object.values(regions),
        marker: { color: 'teal' }
      }], {
        title: 'Total Sales by Location',
        xaxis: { title: 'Location' },
        yaxis: { title: 'Sales ($)' }
      });

      const sortedDates = Object.keys(dates).sort();
      Plotly.newPlot('salesTrend', [{
        type: 'scatter',
        mode: 'lines+markers',
        x: sortedDates,
        y: sortedDates.map(d => dates[d]),
        line: { color: 'royalblue' }
      }], {
        title: 'Transaction Trend Over Time',
        xaxis: { title: 'Date' },
        yaxis: { title: 'Sales ($)' }
      });

      Plotly.newPlot('salesByCategory', [{
        type: 'pie',
        labels: Object.keys(categories),
        values: Object.values(categories)
      }], {
        title: 'Transaction Volume by Type'
      });

      const topSales = Object.entries(salespeople)
        .sort((a, b) => b[1] - a[1])
        .slice(0, 10);
      Plotly.newPlot('topSalespeople', [{
        type: 'bar',
        x: topSales.map(s => s[0]),
        y: topSales.map(s => s[1]),
        marker: { color: 'orange' }
      }], {
        title: 'Top Customer Occupations by Spending',
        xaxis: { title: 'Occupation' },
        yaxis: { title: 'Sales ($)' }
      });

      const boxData = Object.entries(orderValues).map(([region, values]) => ({
        type: 'box',
        name: region,
        y: values,
        boxpoints: 'outliers'
      }));

      Plotly.newPlot('aovPerRegion', boxData, {
        title: 'Transaction Value Distribution per Location',
        yaxis: { title: 'Transaction Amount ($)' }
      });
    }

    generateDashboard(jsonData);
